import React, { useEffect, useState } from "react";
import styled from "styled-components";

const Button = styled.button`
  display: block;
  font-size: 1.2rem;
  font-weight: 600;
  width: auto;
  margin: auto;
  padding: 1rem 2rem;
  color: white;
  background-color: #4cc790;
  border: 2px black solid;
  cursor: pointer;
  transition: 0.2s;
  &:hover {
    background-color: #79dfb1;
  }
  &:active {
    background-color: #3f9b72;
  }
`;

export default function ContributionChart(props) {
  return (
    <Button>
      사이트 열기
      <a style={{ marginTop: "3rem" }} href={props.link} target="_blank"></a>
    </Button>
  );
}
